We need to extract three items:

• Capital contributed by shareholders (in exchange for shares). This is the "Paid-in Capital" found on the Balance Sheet. Its End_amount is 13000000.00.

• Profit (or loss) for a period before deducting tax expense. This is given by the "Profit Before Tax" line item on the Income Statement. Its Amount is 1393861.65.

• The addition in the amount owed by the entity for goods or services purchased on credit. This is the "Accounts Payable" in the Balance Sheet. Its End_amount is 1820000.00.

According to the instructions the final output is to be arranged (by financial statement group) in the order: Balance Sheet, Income Statement, Cash Flow. In our answer we map the three values (capital contributed, profit before tax and accounts payable) as value1, value2 and value3 matching the sample solution format. (The sample solution labels value1 as Paid-in Capital, value2 as Profit Before Tax and value3 as Accounts Payable.)

Thus the solution is:

